import React from 'react';
import styled from '@emotion/styled';

const SetPriority = () => {
  return (
    <SetPriorityStyled>
      <input type='radio' />
    </SetPriorityStyled>
  );
};

const SetPriorityStyled = styled.div`
  background: black;
`;

export default SetPriority;
